.ratio {
  @each $key, $value in $aspect-ratio {
    $name: #{$value}-#{$key};
    &-#{$name} {
      position: relative;
      width: 100%;
      height: 0;
      @include ratio($value, $key);
      // @extend .ratio2;
    }
  }
}
.video-container {
  // @extend .ratio-16-9;
  position: relative;
  width: 100%;
  height: 0;
