    display: block;
    margin-right: auto;
  }
  &-right {
    display: block;
    margin-left: auto;
  }
  &-center {
    display: block;
    margin: auto;
  }
}

//-------------------section padding----------------------------------//
.section {
  &-sm {
    @include py-(20px);
    @include from($md) {
      @include py-(60px);
    }
  }
  &,
  &-md {
    @include py-(40px);
    @include from($md) {
      @include py-(90px);
    }
  }
  &-lg {
    @include py-(60px);
    @include from($md) {
      @include py-(150px);
    }
  }
  &-xl {
