%slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  -webkit-transition: 0.4s;
  transition: 0.4s;
  transition: background-color 0.4s;
  background-color: Var(danger);
}
%slider-before {
  position: absolute;
  content: "";
  background-color: white;
  -webkit-transition: transform 0.4s ease-out;
  transition: transform 0.4s ease-out;
  height: 1.3em;
  width: 1.3em;
  left: 0.15em;
  top: 0.15em;
}

