        width: #{$key}px;
        // width: 100%;
        // max-width: #{$key}px;
      }
      &-#{$key}-max {
        width: 100%;
        max-width: #{$key}px;
      }
      &-#{$key}-min {
        min-width: #{$key}px;
      }
    }
    // rem
    @for $key from 0 to 21 {
      &-#{$key} {
        // width: 100%;
        // max-width: #{$key}rem;
        width: #{$key}rem;
      }
    }
    // %
    @for $i from 0 through 20 {
      &-#{$i*5}\% {
        width: $i * 5%;
      }
    }
    // vw
    @for $i from 1 through 20 {
      &-#{$i*5}vw {
        width: $i * 5vw;
      }
    }
